import React from "react";
import './createLotPopup.css';
import '../App.css';

const CreateLotPopup = () => {
    return(
        <div className="popup-outer-container">
            <div className="popup-inner-container">
                <div className="display_flex space_between">
                    <div>
                        1
                    </div>
                    <div>
                        2
                    </div>
                </div>
            </div>
        </div>
    );
}

export default CreateLotPopup;
